import s from './Friends.module.css'
import Friend from "./Friend/Friend";

let friendData = [
    {name: 'Arman', id: 1},
    {name: 'Nurik', id: 2},
    {name: 'Madya', id: 3},
    {name: 'Damik', id: 4},
    {name: 'Sam', id: 5},
]
let friendElement = [
    <Friend name={friendData[0].name} id={friendData[0].id}/>,
    <Friend name={friendData[1].name} id={friendData[1].id}/>,
    <Friend name={friendData[2].name} id={friendData[2].id}/>,
    <Friend name={friendData[3].name} id={friendData[3].id}/>,
    <Friend name={friendData[4].name} id={friendData[4].id}/>,
]
const Friends = () => {
    return (
        <div className={s.items}>
            {friendElement}
        </div>
    );
};

export default Friends;
